<script lang="ts">export default {  inheritAttrs: false}</script><script setup lang="ts">interface PropsInterface {  id: string,  options: any[],  optionsIDKey?: string,  optionsTitleKey?: string,  modelValue?: any,  colWidth?: number,  label?: string,  error?: string,}const props = withDefaults(defineProps<PropsInterface>(), {  colWidth: 0,  optionsIDKey: 'id',  optionsTitleKey: 'name',});const selected = props.modelValue ? props.modelValue : props.options[0][props.optionsIDKey];const emit = defineEmits<{  (e: 'update:modelValue', value: any): void,  (e: 'changed', value: any): void,}>()const inputClass = {  'border-danger': props.error,  'form-control': true};</script><template>  <AdminUIInputWrap :colWidth="colWidth">    <AdminUIInputLabel v-if="label" :inputID="id">      {{ label }}    </AdminUIInputLabel>    <select        :id="id"        :class="inputClass"        @input="$emit('update:modelValue', $event.target.value)"        v-bind="$attrs"    >      <option v-for="option in options" :value="option[optionsIDKey]" :selected="option[optionsIDKey]===selected">        {{ option[optionsTitleKey] }}      </option>    </select>    <AdminUIInputError v-if="error"/>  </AdminUIInputWrap></template>